CREATE TABLE Rentals (
       PID INT NOT NULL,
       HID INT NOT NULL, 
       PN VARCHAR(50) NOT NULL, 
       S INT NOT NULL, 
       HS VARCHAR(50) NOT NULL,
       HZ INT NOT NULL, 
       HC VARCHAR(50) NOT NULL,
       PRIMARY KEY (PID, HID)
);

CREATE TABLE Boats (
	BL CHAR(2), 
	BNo INT, 
	Z INT, 
	T VARCHAR(50), 
	BN VARCHAR(50), 
	SSN CHAR(10),
	PRIMARY KEY (BL, BNo)
);

CREATE TABLE Projects (
       ID INT NOT NULL,
       PID INT NOT NULL, 
       SID INT NOT NULL, 
       SN VARCHAR(50) NOT NULL, 
       PN VARCHAR(50) NOT NULL, 
       MID INT NOT NULL,
       MN VARCHAR(50) NOT NULL,
       PRIMARY KEY (ID, PID, SID)
);

CREATE TABLE Coffees (
       DID INT NOT NULL,
       HID INT NOT NULL, 
       CID INT NOT NULL, 
       DN VARCHAR(50) NOT NULL, 
       DS VARCHAR(50) NOT NULL, 
       CN VARCHAR(50) NOT NULL,
       CM VARCHAR(50) NOT NULL,
       PRIMARY KEY (DID, HID, CID)
);

CREATE TABLE Customers (
       CID INT NOT NULL,
       CN VARCHAR(50) NOT NULL, 
       CS VARCHAR(50) NOT NULL, 
       CNr INT NOT NULL,
       CZ INT NOT NULL,
       CC VARCHAR(50) NOT NULL,
       EID INT NOT NULL,
       PRIMARY KEY (CID)
);
